import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { HttpClientModule } from '@angular/common/http';
import { ReactiveFormsModule } from '@angular/forms';
import { ToastrModule } from 'ngx-toastr';
import { BrowserAnimationsModule } from '@angular/platform-browser/animations';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { MostrardisciplinaComponent } from './components/mostrardisciplina/mostrardisciplina.component';
import { CreardisciplinaComponent } from './components/creardisciplina/creardisciplina.component';
import { CrearCompetidorComponent } from './components/crear-competidor/crear-competidor.component';
import { CrearStakeComponent } from './components/crear-stake/crear-stake.component';
import { CrearEventComponent } from './components/crear-event/crear-event.component';
import { MostrarCompetidorComponent } from './components/mostrar-competidor/mostrar-competidor.component';
import { MostrarStakeComponent } from './components/mostrar-stake/mostrar-stake.component';
import { MostrarEventComponent } from './components/mostrar-event/mostrar-event.component';


@NgModule({
  declarations: [
    AppComponent,
    MostrardisciplinaComponent,
    CreardisciplinaComponent,
    CrearCompetidorComponent,
    CrearStakeComponent,
    CrearEventComponent,
    MostrarCompetidorComponent,
    MostrarStakeComponent,
    MostrarEventComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    HttpClientModule,
    ReactiveFormsModule,
    ToastrModule.forRoot(),
    BrowserAnimationsModule,
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
